import React from "react";
import { Redirect } from "react-router-dom";
import { Route } from "react-router-dom";

import { isUserAuthenticated, getLoggedInUser } from "./helpers/authUtils";

// lazy load all the views
const Dashboard = React.lazy(() => import("./pages/dashboards/"));

// auth
const Login = React.lazy(() => import("./pages/auth/Login"));
const Logout = React.lazy(() => import("./pages/auth/Logout"));
const ForgetPassword = React.lazy(() =>
  import("./pages/account/ForgetPassword")
);
const Register = React.lazy(() => import("./pages/account/Register"));
const ConfirmAccount = React.lazy(() => import("./pages/account/Confirm"));

// handle auth and authorization

const PrivateRoute = ({ component: Component, roles, ...rest }) => (
  <Route
    {...rest}
    render={props => {
      const isAuthTokenValid = isUserAuthenticated();
      if (!isAuthTokenValid) {
        // not logged in so redirect to login page with the return url
        return (
          <Redirect
            to={{ pathname: "/login", state: { from: props.location } }}
          />
        );
      }

      const loggedInUser = getLoggedInUser();
      // check if route is restricted by role
      if (roles && roles.indexOf(loggedInUser.role) === -1) {
        // role not authorised so redirect to home page
        return <Redirect to={{ pathname: "/" }} />;
      }

      // authorised so return component
      return <Component {...props} />;
    }}
  />
);

const routes = [
  // auth and account
  { path: "/login", name: "Login", component: Login, route: Route },
  { path: "/logout", name: "Logout", component: Logout, route: Route },
  {
    path: "/forget-password",
    name: "Forget Password",
    component: ForgetPassword,
    route: Route
  },
  { path: "/register", name: "Register", component: Register, route: Route },
  {
    path: "/confirm",
    name: "Confirm",
    component: ConfirmAccount,
    route: Route
  },

  // other pages
  {
    path: "/dashboard",
    name: "Dashboard",
    component: Dashboard,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/categories-list",
    name: "Categories",
    component: CategoryContainer,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/categories-pendings",
    name: "Categories pendings",
    component: CategoryPendings,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/categories-create",
    name: "Categories - create",
    component: CategoryAdd,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/categories/:id",
    name: "Categories",
    component: CategoryEdit,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/service-types-list",
    name: "Service types",
    component: ServiceTypeContainer,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/service-types-create",
    name: "Service types - create",
    component: ServiceTypeAdd,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/service-types/:id",
    name: "Service types",
    component: ServiceTypeEdit,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/service-list",
    name: "Services",
    component: ServiceContainer,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/service-pendings",
    name: "Services",
    component: ServicePendings,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/service-create",
    name: "Service - create",
    component: ServiceAdd,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/service/:id",
    name: "Service",
    component: ServiceEdit,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/product-list",
    name: "Products",
    component: ProductContainer,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/product/:id",
    name: "Product",
    component: ProductDetails,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/product-flagged",
    name: "Products",
    component: ProductFlagged,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/",
    exact: true,
    component: () => <Redirect to="/dashboard" />,
    route: PrivateRoute
  },
  {
    path: "/users",
    exact: true,
    name: "Users",
    component: UserContainer,
    route: PrivateRoute,
    roles: ["Admin"]
  },
  {
    path: "/users/:id",
    name: "Users details",
    component: UserDetails,
    route: PrivateRoute,
    roles: ["Admin"]
  }
];

export { routes, PrivateRoute };
